import React ,{useState}from "react";
import cancel from '../components/images/cancel.jpg';
import black_x from "../components/images/black_x.jpg"


const Create = () => {
  const [user, setDetails] = useState({
    username: "",
    phone_no: "",
    month:"",
    date:"",
    year:"",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setDetails((prev) => ({...prev,[name]: value
    }));
  };
  const handleSubmit=(e)=>{
    e.preventDefault();
  console.log(user);
}

  return (
    <form  onSubmit={handleSubmit} className="main_sign">
      <div className="sign-in"><span className="cross_div" ><a className="cre" href="/public">
        <img className="cross" height="20px" width="20px" src={cancel} alt="img" /></a></span>
        <div className="nav_1"><div>
              <img
                height="60px"
                width="60px"
                className="x-mark"
                src={black_x}
                alt="x-mark"
              />
            </div>
        </div>
        <div className="down-box">
          <div className="content">

          <p className="acc">Create Account</p>
          <input
                  className="box_1"
                  type="text"
                  name="username"
                  value={user.name}
                  onChange={handleChange} // Use the defined function
                  placeholder="Name"
                  maxLength="50"/>

                <input
                  className="box_1"
                  type="tel" // Use tel input type for phone numbers
                  name="phone_no"
                  value={user.phone}
                  onChange={handleChange} // Use the defined function
                  placeholder="Phone Number"
                  maxLength="20"
                />
          <div className="_line "><div>Use Email Insted</div>
          </div>
          <div className="dob">Date of Birth</div>
          <div>This will not be shown publicly. Confirm your own age, even if this account is for a business, a pet, or something else.</div>
          <div className="all_boxes">
          <div  className="box_A month"><label>Month</label>
         <select name="month" value={user.month} onChange={handleChange} className="select">
 {/* Generate options for months from January to December */}
 {Array.from({ length: 12 }, (_, index) => {
    const monthIndex = index + 1;
    const month = monthIndex < 10 ? `0${monthIndex}` : `${monthIndex}`; // Add leading zero if month index is less than 10
    return (
      <option key={month} value={month}>
        {new Date(2000, index, 1).toLocaleString('default', { month: 'long' })}
      </option>
    );
  })}
      </select>
            </div>
            <div className="box_A date"><label>Date</label>

         <select value={user.date} onChange={handleChange} name="date" className="select">
         {/* Generate options for dates from 01 to 30 */}
         {Array.from({ length: 30 }, (_, index) => {
          const day = index + 1;
          const formattedDay = day < 10 ? `0${day}` : `${day}`; // Add leading zero if day is less than 10
          return (
            <option key={formattedDay} value={formattedDay}>{formattedDay}</option>
          );
        })}

      </select>
            </div>
            <div className="box_A year"><label>Year</label>
         <select name="year" value={user.year} onChange={handleChange} className="select">
         <option value="option1"></option>
        <option value="option1">2001</option>
        <option value="option2">2002</option>
        <option value="option3">2003</option>
        <option value="option4">2004</option>
        <option value="option5">2005</option>
        <option value="option5">2006</option>
        <option value="option5">2007</option>
        <option value="option5">2008</option>
        <option value="option5">2009</option>
        <option value="option5">2010</option>
        <option value="option5">2012</option>
        <option value="option5">2012</option>
      </select>
            </div></div>
            <button type = "submit" className="box_ grey">Next</button>
          </div>
          <div />
        </div>
      </div>
    </form>
  )
  };
export default Create;
